import React from 'react';
import 'react-social-icons';
import { SocialIcon } from 'react-social-icons';
import './style.css';

const footer = () => {
    return (
        <div className="footer-social">
            <div className="d-flex align-items-center justify-content-center">
            <span className="display:inline-block; width: 10px;">
                <SocialIcon url="https://www.linkedin.com/in/alen-sudec-0805641a0/" fgColor="#FFFFFF" className="footer-pic"/>
                <SocialIcon url="https://github.com/AlenSudec" fgColor="#FFFFFF" className="footer-pic"/>
                <SocialIcon url="https://www.instagram.com/alensudec/" fgColor="#FFFFFF"/>
                <SocialIcon url="https://www.facebook.com/alen.sudec/" fgColor="#FFFFFF"/>
                </span>
            </div>
        </div>
    )
}

export default footer;
